import React from 'react';

const ContactTable = ({ contacts }) => {
    return (
        <table>
            <thead>
            <tr>
                <th>Name</th>
                <th>Phone</th>
                <th>Address</th>
                <th>Email</th>
            </tr>
            </thead>
            <tbody>
            {contacts.map((contact) => (
                <tr key={contact.id}>
                    <td>{contact.name}</td>
                    <td>{contact.phone}</td>
                    <td>{contact.address}</td>
                    <td>{contact.email}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
};

export default ContactTable;
